import React from 'react';
import './App.css';

function Header() {
  return (
    <header>
     <div class ='header'>
     <div class="btn-light" >Дорадник</div>
    <div class="btn-light" >Журнал групи</div>
    <div class="btn-light" >Список групи</div>
    <div class="btn-light">Особиста сторінка</div>
    </div>
    </header>
  );
}

export default Header;
